Return of the J's: Shamrock V, Velsheda and Endeavour

Technology Documentary hosted by Nick Hayward-Young, published by Grove Television in 2001 - English narration


Information
------------------------------

Designed to compete for the America's Cup between 1930 and 1937, only ten J-Class yachts were ever built - six in the USA and four in England. Of these, only three have survived. Return of the J's is their story.
Shamrock V, Velsheda &amp; Endeavour - three yachts whose stories are at the heart of yachting legend - stories of proud, patriotic owners and of the glory-days racing for the America's Cup and of how, after many owners and sad tales of abandoned, rusting, rotting hulls, each has come to be so gloriously restored and to be racing together for the first time in home waters for 65 years.
Combining archive film with breathtaking new footage Return of the J's is a unique tribute to the most famous and spectacular class of racing yacht of all time.
Includes Special feature of the J's in action at Antigua Classics 2001.

